import { useEffect, useState } from "react";
import M from "materialize-css";
const AdminList=()=>{
   const [data,setData]=useState({})
   useEffect(()=>{
    fetch("/admin/viewAdmins")
    .then(res=>res.json())
    .then(data=>{
        console.log(data)
       if(data.error){
          M.toast({html: data.error,classes:"#c62828 red darken-3"})
       }
       else{
            console.log(data)
            setData(data)
       }
    }).catch(err=>{
        console.log(err)
    })
   },[])
    return(
        <table>
        <thead>
          <tr>
              <th>Name</th>
              <th>First Name</th>
              <th>Last Nmae</th>
              <th>Email</th>
          </tr>
        </thead>

        <tbody>


        {data.map(item=>{
            return(
                <tr>
            <td>Alvin</td>
            <td>Eclair</td>
            <td>$0.87</td>
          </tr>
            )
        })}
          
          
        </tbody>
      </table>
    )
}

export default AdminList;
